import React, {Component} from 'react';
import {Link} from "react-router-dom";
import './Notification.css';


export default class Notification extends Component{

	render(){
		return(
			<div className="wrapper">
				<p className="notif">{this.props.msg}</p>
			</div>
		);
	}

}
